import { CircularProgressBar } from "@tomickigrzegorz/react-circular-progress-bar";
import styled from "styled-components";


const Text = styled.p`
    position: absolute;
    top : 45%;
    left : 42%;
    font-size : 18px;
`



function CicleProgress() {

    return (
        <>

<CircularProgressBar
  animationSmooth="1s ease-out"
  colorCircle="#f1f1f1"
  colorSlice="#FF6D00"
  percent={75}
  size={100}
/>

        </>
    )

}

export default CicleProgress
